tables.table_schema:
CREATE TABLE trading_strategies (
    trading_id INT PRIMARY KEY,
    strategy_name TEXT,
    market_data JSONB,
    trend_analysis JSON
);

CREATE TABLE trading_strategies (
    strategy_id INT PRIMARY KEY,
    strategy_name VARCHAR(255),
    analysis_period INT,
    risk_level INT
);

CREATE TABLE market_data (
    data_id INT PRIMARY KEY,
    market_trend VARCHAR(255),
    price_change DECIMAL(10,2),
    volume INT
);

CREATE TABLE market_data (
  symbol VARCHAR(255),
  price FLOAT,
  volume INT,
  timestamp TIMESTAMP
);

CREATE TABLE trading_strategies (
  strategy_id INT,
  strategy_name VARCHAR(255),
  description TEXT,
  created_on DATE
);

CREATE TABLE market_trends (
  trend_id INT,
  trend_type VARCHAR(50),
  start_date DATE,
  end_date DATE
);

CREATE TABLE strategy_results (
  result_id INT,
  strategy_id INT,
  timestamp TIMESTAMP,
  profit_loss DECIMAL(10,2)
);
